import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Customerresister() {
  const [name, setName] = useState("");
  const [gmail, setGmail] = useState("");
  const [password, setPassword] = useState("");
  const [nameTouched, setNameTouched] = useState(false);
  const [gmailTouched, setGmailTouched] = useState(false);
  const [passwordTouched, setPasswordTouched] = useState(false);


 const navigate = useNavigate();


  const isNameValid = name.length >= 3;
  const isGmailValid = gmail.includes("@gmail.com");
  const isPasswordValid = password.length > 6;

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!isNameValid) {
      alert("Name is invalid");
      return;
    }
    if (!isGmailValid) {
      alert("Gmail is invalid");
      return;
    }
    if (!isPasswordValid) {
      alert("Password is invalid");
      return;
    }

    try {
      const response = await fetch("http://localhost:5000/customer-resister", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ name, gmail, password }),
      });

      const result = await response.json();
      if (response.ok) {
        alert("Customer registered successfully!");
        navigate("/customerlogin"); 
      } else {
        alert(result.message);
      }
    } catch (error) {
      console.error("Error submitting the form:", error);
      alert("An error occurred. Please try again.");
    }
  };

  return (
    <div>
      <h1>Customer RESISTER</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            onFocus={() => setNameTouched(true)}
          />
          {nameTouched && !isNameValid && (
            <span style={{ color: "red" }}>Name is invalid</span>
          )}
        </div>
        <div>
          <input
            type="text"
            value={gmail}
            onChange={(e) => setGmail(e.target.value)}
            onFocus={() => setGmailTouched(true)}
          />
          {gmailTouched && !isGmailValid && (
            <span style={{ color: "red" }}>Gmail is invalid</span>
          )}
        </div>
        <div>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            onFocus={() => setPasswordTouched(true)}
          />
          {passwordTouched && !isPasswordValid && (
            <span style={{ color: "red" }}>Password is invalid</span>
          )}
        </div>
        <button
          type="submit"
          disabled={!isNameValid || !isGmailValid || !isPasswordValid}
        >
          Submit
        </button>
      </form>
    </div>
  );
}
